function App() {

  const manejarClick = () => {
    console.log('Click');
  }

  const reiniciarContador = () => {
    console.log('Reiniciar');
  }

  return (
    <div className="App">
      <div className='ieslavereda-logo-contenedor'>
        <img 
          className='ieslavereda-logo'
          src={ieslaveredalogo}
          alt='Logo de IES La Vereda' />
      </div>
      <Contador/>
      <div className="contenedor-principal">
        <Boton 
          texto_boton='Click'
          esBotonDeClick={ true }
          manejarClick={ manejarClick }/>
